getArabicText=(value)=>{
  return value.split(" ").reverse().join("  ");
}
getStatusText=(value)=>{
  if(value.region!= '' && value.gouvernorat!=''){
    return this.getArabicText(`${value.function} بمحلية ${value.gouvernorat}`);
  }
  if(value.region!= '' && value.gouvernorat==''){
    let item = this.state.dataSource.filter(function (el) {
      return el.value == value.region
    });
    if(!item.length==0)
      return this.getArabicText(`${value.function} بجهة ${item[0].label}`);
    else
    return this.getArabicText(`${value.function} بــ ${value.region}`);
  }
  if(value.region== '' && value.gouvernorat==''){
    return this.getArabicText(`${value.function}`);
  }
  return  this.getArabicText(`${value.function}`);
}


